import { Marquee } from './Marquee.js';
import { NewNews } from './NewNews.js';

export function Colleft(props) {

    return React.createElement(
        'div',
        { className: 'colLeft' },
        React.createElement('iframe', { className: 'video', src: 'https://www.facebook.com/plugins/video.php?href= https%3A%2F%2Fwww.facebook.com%2Fwatch%2F?v=787813908626947&width=300&height=170&show_text=false&appId=1409908175930143', width: '300', height: '170', scrolling: 'no', frameBorder: '0', allowtransparency: 'true', allowFullScreen: true }),
        React.createElement(Marquee, { txt: '\u042D\u0440\u04AF\u04AF\u043B \u043C\u044D\u043D\u0434\u0438\u0439\u043D \u044F\u0430\u043C\u043D\u0430\u0430\u0441 \u043A\u043E\u0440\u043E\u043D\u0430\u0432\u0438\u0440\u0443\u0441\u043D\u0438\u0439 \u0445\u0430\u043B\u0434\u0432\u0430\u0440\u044B\u043D \u043D\u04E9\u0445\u0446\u04E9\u043B \u0431\u0430\u0439\u0434\u0430\u043B,  \u0442\u0430\u0440\u0445\u0430\u043B\u0442\u044B\u043D \u0442\u0430\u043B\u0430\u0430\u0440\u0445 \u044D\u044D\u043B\u0436\u0438\u0442 \u043C\u044D\u0434\u044D\u044D\u043B\u043B\u044D\u044D \u0445\u0438\u0439\u0436 \u0431\u0430\u0439\u043D\u0430.' }),
        React.createElement(NewNews, null)
    );
}
